CAA2DCoordinate CAAFK5_1_Catalog::GetCatalogStarByNumber(unsigned int idx, double JD)
{
	CAAFK5_1_Catalog::FK5_I_star_record p;
	double T, Obliquity, NutationInLongitude, NutationInEcliptic, AlphaNutation, DeltaNutation, J2000_JD = 2451545.0;
	CAA2DCoordinate h, rade;
	unsigned int i;

	// get the star from catalog
	p = FK5_I_star_catalog[0];
	for(i = 0; i < numFK5_I_stars; i++)
	{
		if(idx == FK5_I_star_catalog[i].FK1_Number)
		{
			p = FK5_I_star_catalog[i];
			break;
		}
	}

	// adapted vom AATest.cpp line 1247
	// ephem --traditional  --t fk5 --catn 93 --UTC "2028-11-13 19:00:00" returns:
	// 2028-11-13 19:00:00 +02h46m14.39s +4921m07.55s
	// is example 23a on page 153 which is	+02h46m14.39s +4921m07.45s

	rade.X = CAACoordinateTransformation::DMSToDegrees(p.ra_hour, p.ra_minute, p.ra_second);

	if(p.de_deg < 0.0)
		rade.Y = -CAACoordinateTransformation::DMSToDegrees(-p.de_deg,  p.de_minute, p.de_second, false);
	else
		rade.Y = CAACoordinateTransformation::DMSToDegrees(p.de_deg,  p.de_minute, p.de_second);

	// page 150 A-C
	// proper motion

	// fraction of hundered years from J2000
	T = (JD - J2000_JD)/36525;

	rade.X = CAACoordinateTransformation::MapTo0To24Range(      rade.X + T*p.ra_properMotion_SecPerHunderedYears/3600.0);
	rade.Y = CAACoordinateTransformation::MapToMinus90To90Range(rade.Y + T*p.de_properMotion_ArcSecPerHunderedYears/3600.0);

	// aberration
	h = CAAAberration::EquatorialAberration(rade.X, rade.Y, JD, true);
	rade.X = CAACoordinateTransformation::MapTo0To24Range(		rade.X + h.X);
	rade.Y = CAACoordinateTransformation::MapToMinus90To90Range(rade.Y + h.Y);

	// precession
	rade = CAAPrecession::PrecessEquatorial(rade.X, rade.Y, J2000_JD, JD);

	// nutation
	Obliquity = CAANutation::MeanObliquityOfEcliptic(JD);
	NutationInLongitude = CAANutation::NutationInLongitude(JD);
	NutationInEcliptic = CAANutation::NutationInObliquity(JD);
	AlphaNutation = CAANutation::NutationInRightAscension(rade.X, rade.Y, Obliquity, NutationInLongitude, NutationInEcliptic);
	DeltaNutation = CAANutation::NutationInDeclination(rade.X, Obliquity, NutationInLongitude, NutationInEcliptic);

	rade.X = CAACoordinateTransformation::MapTo0To24Range(		rade.X + CAACoordinateTransformation::DMSToDegrees(0, 0, AlphaNutation/15));
	rade.Y = CAACoordinateTransformation::MapToMinus90To90Range(rade.Y + CAACoordinateTransformation::DMSToDegrees(0, 0, DeltaNutation));

	return rade;
}


